// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract AdvancedCounter {
    uint256 private value;
    uint256 public totalOperations;
    address public lastChanger;

    mapping(address => uint256) public userOperations;

    // --- Events ---
    event ValueChanged(
        address indexed changer,
        uint256 indexed newValue,
        uint256 indexed oldValue,
        string operation
    );

    event Milestone(
        uint256 indexed value,
        address indexed achiever,
        string message
    );

    // --- Constructor ---
    constructor() {
        value = 0;
        totalOperations = 0;
    }

    // --- Core Functions ---
    function get() public view returns (uint256) {
        return value;
    }

    function set(uint256 newValue) public {
        uint256 oldValue = value;
        value = newValue;
        _logChange("set", oldValue);
        _checkMilestone();
    }

    function increment() public {
        uint256 oldValue = value;
        value += 1;
        _logChange("increment", oldValue);
        _checkMilestone();
    }

    function decrement() public {
        uint256 oldValue = value;
        require(value > 0, "Cannot decrement below zero");
        value -= 1;
        _logChange("decrement", oldValue);
    }

    function add(uint256 amount) public {
        uint256 oldValue = value;
        value += amount;
        _logChange("add", oldValue);
        _checkMilestone();
    }

    function subtract(uint256 amount) public {
        uint256 oldValue = value;
        require(value >= amount, "Underflow");
        value -= amount;
        _logChange("subtract", oldValue);
    }

    function double() public {
        uint256 oldValue = value;
        value *= 2;
        _logChange("double", oldValue);
        _checkMilestone();
    }

    function halve() public {
        uint256 oldValue = value;
        value /= 2;
        _logChange("halve", oldValue);
    }

    function reset() public {
        uint256 oldValue = value;
        value = 0;
        _logChange("reset", oldValue);
    }

    // --- Stats Functions ---
    function getStats()
        public
        view
        returns (
            uint256,
            uint256,
            address
        )
    {
        return (value, totalOperations, lastChanger);
    }

    function getUserStats(address user) public view returns (uint256) {
        return userOperations[user];
    }

    // --- Internal Helpers ---
    function _logChange(string memory operation, uint256 oldValue) internal {
        totalOperations += 1;
        userOperations[msg.sender] += 1;
        lastChanger = msg.sender;

        emit ValueChanged(msg.sender, value, oldValue, operation);
    }

    function _checkMilestone() internal {
        if (value % 10 == 0 && value != 0) {
            emit Milestone(value, msg.sender, "Reached a multiple of 10!");
        }
    }

    // --- Payable fallbacks ---
    fallback() external payable {}
    receive() external payable {}
}

